import {data} from "../../data";
import "./products.css";

const Products = () => {
    return (
        <div>
            {
                data.map (dato => (
                    <div className="card" key={dato.id}>                    
                        <img src = {dato.img} alt = "imagen producto" />
                        <h3>{dato.nombre}</h3>
                        <h4>${dato.precio}</h4>
                        <h4>{dato.cantidad}</h4>

                        <button>Comprar</button>
                    </div>
                    )
                )
            }
        </div>
    )
}

export default Products
